.form-elements {
    max-width: 1440px;
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    grid-column-gap: 50px;
    grid-row-gap: 20px;
    margin: 140px;
}

.description {
    max-width: 320px;
    margin-bottom: 5px;
    @include h3-text;
}


//classes for dropdowns js scripts
// do separate

.button-hidden {
    visibility: hidden;
}
.button-pointer {
    cursor: pointer;
}
.hidden {
    display: none;
}
.border {
    border-radius: 4px;
    border-color: $dark-shade-25-color;
}
.border-focus {
    border-radius: 4px 4px 0 0;
    border-color: $dark-shade-50-color;
}

.common-dropdown {
    position: absolute;
    background-color: #FFF;
    z-index: 1;
    margin-top: -1px;
    border: 1px solid $dark-shade-50-color;
    border-radius: 0 0 4px 4px;
    padding: 7px;
    padding-top: 5px;
    padding-left: 15px;
    &__rows {
        height: 103px;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
    }
    &__buttons {
        margin-top: 25px;
        margin-bottom: 6px;
        display: flex;
        justify-content: space-between;
        font-family: Montserrat;
        font-size: 12px;
        color: $purple-color;
        text-transform: uppercase;
        font-weight: bold;
    }
    &__clear {
        color: $dark-shade-50-color;
    }
    &__submit {
        cursor: pointer;
    }
}
